pragma solidity >=0.4.21 <0.7.0;

import "./api/Storage/StorageApi.sol";
import "./Base.sol";

contract Proxy is Base{

    constructor(address _storageAddress, uint256 _version, string memory _name,string memory  _info) Base(_storageAddress,_version,_name,_info,tx.origin) public {
    }
    function getAbi(string memory _name) public view returns (string memory){
        string memory abiJson = storageApi.getString(keccak256(abi.encodePacked("Abi", _name)));
        //require(keccak256(abi.encodePacked(abiJson)) != keccak256(abi.encodePacked("")), "Contract not found.");
        return abiJson;
    }

    function getContract(string memory _name) public view returns (address){
        address contractAddress = storageApi.getAddress(keccak256(abi.encodePacked("Contract", _name)));
        //require(address(contractAddress) != address(0x0), "Contract not found.");
        return contractAddress;
    }

}
